import React from 'react';
import { Outlet } from 'react-router-dom';

const AdminRoutes = () => {
    const user = JSON.parse(localStorage.getItem('user'));

    return user != null && user.isAdmin ? <Outlet /> : null;
}

export default AdminRoutes;
